import styled from "styled-components";

const MainContainer = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  padding-top: 5rem;
  background-color: aliceblue;
  width: 100%;
  height: calc(100vh - 10rem);
`;

function Main() {
  return (
    <MainContainer>
      <span>Main Page</span>
    </MainContainer>
  );
}

export default Main;
